import { useMemo } from 'react';
import {
  MaterialReactTable,
  useMaterialReactTable,
} from 'material-react-table';

const data = [
  {
    main: 'Main Ranking 1',
    add: 'Additional Ranking 1',
    weight: 0.5,
  },
];

const Table = () => {
  //should be memoized or stable
  const columns = useMemo(
    () => [
      {
        accessorKey: 'main',
        header: 'Main Rankings',
        size: 200,
        enableEditing: false,
      },
      {
        accessorKey: 'add',
        header: 'Additional Rankings',
        size: 200,
        enableEditing: false,

      },
      {
        accessorKey: 'weight', 
        header: 'Weights (0 to 1)',
        size: 200,
        enableEditing: true,
      },
    ],
    [],
  );

  const table = useMaterialReactTable({
    columns,
    data, 
    enableEditing: true,
    onEditingRowSave: ({ table, values }) => {
      //validate data
      //save data to api
      table.setEditingRow(null); //exit editing mode
    },
    onEditingRowCancel: () => {
      //clear any validation errors
    },
    muiEditRowDialogProps: {
      //optionally customize the dialog
    },
    renderEditRowDialogContent: ({ internalEditComponents, row, table }) => {
      //optionally, completely override the render of the dialog content
      //use `internalEditComponents` to render the generated text fields, or completely render your own form and inputs
    },
  });

  return <MaterialReactTable 
  table={table} />;
};

export default Table;
